import React, { useState } from 'react';

const SurgeryForm = () => {
  // State for each form field
  const [date_Procedure, setDate_Procedure] = useState('');
  const [postOpDay, setPostOpDay] = useState('');
  const [purulentDischarge, setPurulentDischarge] = useState('');
  const [localizedPain, setLocalizedPain] = useState('');
  const [localizedSwelling, setLocalizedSwelling] = useState('');
  const [fever, setFever] = useState('');
  const [incisionDeliberatelyOpened, setIncisionDeliberatelyOpened] = useState('');
  const [spontaneousDehiscence, setSpontaneousDehiscence] = useState('');
  const [abscess, setAbscess] = useState('');
  const [microorganismsSeen, setMicroorganismsSeen] = useState('');
  const [evidenceOfInfection, setEvidenceOfInfection] = useState('');
  const [positiveCulture, setPositiveCulture] = useState('');
  const [bloodCultureSent, setBloodCultureSent] = useState('');
  const [diagnosisSSI, setDiagnosisSSI] = useState('');
  const [anyOther, setAnyOther] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log({
      date_Procedure,
      postOpDay,
      purulentDischarge,
      localizedPain,
      localizedSwelling,
      fever,
      incisionDeliberatelyOpened,
      spontaneousDehiscence,
      abscess,
      microorganismsSeen,
      evidenceOfInfection,
      positiveCulture,
      bloodCultureSent,
      diagnosisSSI,
      anyOther
    });
  };

  return (
    <div style={{ width: '100%', margin: '0 auto', backgroundColor: '#f4f4f4', padding: '20px', borderRadius: '8px' }}>
      <form onSubmit={handleSubmit} style={{ display: 'flex', flexDirection: 'column' }}>
        <h2>Surgery Procedure Form</h2>

        <table style={{ width: '100%', borderCollapse: 'collapse', textAlign: 'center' }}>
          <thead>
            <tr>
              <th style={tableHeaderStyle}>Date of Procedure</th>
              <th style={tableHeaderStyle}>Post Op Day</th>
              <th style={tableHeaderStyle}>Purulent Discharge</th>
              <th style={tableHeaderStyle}>Localized Pain</th>
              <th style={tableHeaderStyle}>Localized Swelling</th>
              <th style={tableHeaderStyle}>Fever</th>
              <th style={tableHeaderStyle}>Incision Deliberately Opened</th>
              <th style={tableHeaderStyle}>Spontaneous Dehiscence</th>
              <th style={tableHeaderStyle}>Abscess</th>
              <th style={tableHeaderStyle}>Micro-organisms Seen</th>
              <th style={tableHeaderStyle}>Evidence of Infection</th>
              <th style={tableHeaderStyle}>Positive Culture</th>
              <th style={tableHeaderStyle}>Blood Culture Sent</th>
              <th style={tableHeaderStyle}>Diagnosis SSI</th>
              <th style={tableHeaderStyle}>Any Other</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td style={tableCellStyle}><input type="date" value={date_Procedure} onChange={(e) => setDate_Procedure(e.target.value)} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="number" value={postOpDay} onChange={(e) => setPostOpDay(e.target.value)} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" value={purulentDischarge} onChange={(e) => setPurulentDischarge(e.target.value)} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" value={localizedPain} onChange={(e) => setLocalizedPain(e.target.value)} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" value={localizedSwelling} onChange={(e) => setLocalizedSwelling(e.target.value)} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" value={fever} onChange={(e) => setFever(e.target.value)} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" value={incisionDeliberatelyOpened} onChange={(e) => setIncisionDeliberatelyOpened(e.target.value)} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" value={spontaneousDehiscence} onChange={(e) => setSpontaneousDehiscence(e.target.value)} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" value={abscess} onChange={(e) => setAbscess(e.target.value)} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" value={microorganismsSeen} onChange={(e) => setMicroorganismsSeen(e.target.value)} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" value={evidenceOfInfection} onChange={(e) => setEvidenceOfInfection(e.target.value)} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" value={positiveCulture} onChange={(e) => setPositiveCulture(e.target.value)} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" value={bloodCultureSent} onChange={(e) => setBloodCultureSent(e.target.value)} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" value={diagnosisSSI} onChange={(e) => setDiagnosisSSI(e.target.value)} style={inputStyle} /></td>
              <td style={tableCellStyle}><input type="text" value={anyOther} onChange={(e) => setAnyOther(e.target.value)} style={inputStyle} /></td>
            </tr>
          </tbody>
        </table>

        <button type="submit" style={{ marginTop: '20px', padding: '10px 15px', backgroundColor: '#28a745', color: 'white', border: 'none', borderRadius: '4px', cursor: 'pointer' }}>
          Submit
        </button>
      </form>
    </div>
  );
};

// Inline styles for table elements
const tableHeaderStyle = {
  backgroundColor: '#ddd',
  padding: '10px',
  border: '1px solid #ccc',
};

const tableCellStyle = {
  padding: '10px',
  border: '1px solid #ccc',
};

const inputStyle = {
  width: '100%',
  padding: '8px',
  border: '1px solid #ccc',
  borderRadius: '4px',
};

export default SurgeryForm;
